from typing import List

class Solution:
    def minOperations(self, nums1: List[int], nums2: List[int]) -> int:
        n = len(nums1)
        ops = 0

        while True:
            max1 = max(nums1)
            max2 = max(nums2)

            if nums1[n-1] == max1 and nums2[n-1] == max2:
                return ops

            max1_idx = nums1.index(max1)
            max2_idx = nums2.index(max2)

            if max1_idx == n-1 and max2_idx == n-1:
                return ops

            if max1_idx != n-1:
                nums1[max1_idx], nums2[max1_idx] = nums2[max1_idx], nums1[max1_idx]
                ops += 1

            if max2_idx != n-1 and nums2[n-1] != max2:
                nums1[max2_idx], nums2[max2_idx] = nums2[max2_idx], nums1[max2_idx]
                ops += 1

            if nums1 == sorted(nums1) and nums2 == sorted(nums2) and nums1[n-1] == max1 and nums2[n-1] == max2:
                return ops

            if nums1[n-1] != max1 and nums2[n-1] != max2:
                return -1
